      function handleAnimationData(a) {

          b.frame_descriptor.forEach(bone => {

              acc[bone.node + '-pos'].push(...data.slice(index, index + 3))
            } else {

              acc[bone.node].push(...data.slice(index, index + 4))
            }
          })
          return acc
        }, {})
        return { times, values }
      }

      function createAnimation({ times, values }, name = 'test') { // 
        const tracks = []
        for (const key in values) {
          if (key.includes('-pos')) {
            tracks.push(new THREE.KeyframeTrack(key.split(':').join('').slice(0, -4) + '.position', new Float32Array(times), new Float32Array(values[key])))
          } else {
            tracks.push(new THREE.KeyframeTrack(key.split(':').join('') + '.quaternion', new Float32Array(times), new Float32Array(values[key])))
          }
        }
        return new THREE.AnimationClip(name, times[times.length - 1], tracks)

    <script>
      +function(THREE, Stats, initConfig) {
        const { OrbitControls, FBXLoader } = THREE
        const { GUI } = lil

        const container = document.createElement('div')
				document.body.appendChild( container ) // 

				const scene = new THREE.Scene()
        const renderer = new THREE.WebGLRenderer({ antialias: true })
        const clock = new THREE.Clock()
        let isPause = false
        let staticAnimationAction = null
        let camera = null
        let controls = null
        let stats = null
        let gui = null
        let mixer = null
        let animations = null
        let bones = null // 
        
        init(initConfig)
        render()
        function loadModel(url = '') { // 
          const loader = new FBXLoader()
          loader.load(url, object => {
            mixer = new THREE.AnimationMixer(object)
            animations = [].concat(staticAnimations, object.animations).map(animation => { // 
              const action = mixer.clipAction(animation)
              action.clampWhenFinished = true
              action.timeScale = 1
              action.setLoop(THREE.LoopOnce)
              return action
            })

            staticAnimationAction = mixer.clipAction(staticAnimation)
            staticAnimationAction.play()
            mixer.addEventListener('finished', e => { // 
              staticAnimationAction.play()
            })

            bones = getBonesGroup(object.children[0])
            object.traverse(child => {
              if (child.isMesh) {
                child.castShadow = true
                child.receiveShadow = true
              }
            })
            // const helper = new THREE.SkeletonHelper( object )
            // scene.add( helper ) // 
            scene.add( object )

            gui = new GUI()
            setupDatGui(bones, animations) // 
          })
        }

        function getBonesGroup(bones) { // 
          const classes = ['leg', 'shoulder']
          const group = {}
          recursion(bones)
          function recursion(bone) {
            bone.children.forEach(bone => {
              recursion(bone)
            })
            classes.forEach(tag => {
              if (bone.name.toLowerCase().includes(tag)) {
                group[tag] ||= []
                group[tag].push(bone)
              }
            })
          }
          return group
        }

        function init(config = {}) { // 
				  camera = new THREE.PerspectiveCamera( 45, window.innerWidth / window.innerHeight, 1, 2000 )
          camera.position.set( 30, 100, 300 )
          scene.background = new THREE.Color( 0xa0a0a0 )
          renderer.setPixelRatio(window.devicePixelRatio)
          renderer.setSize(window.innerWidth, window.innerHeight)
          renderer.shadowMap.enabled = true
          container.appendChild(renderer.domElement)
          
          if (!config.noStats) {
            stats = new Stats()
            container.appendChild(stats.dom)
          }

          controls = new OrbitControls( camera, renderer.domElement )
          controls.target.set( 0, 100, 0 )
          controls.update()

          !config.noGround && initGround()
          initLight()
          loadModel(config.url)   
        }

        function initLight(flag = true) { // 
          if (!flag) return
          const hemiLight = new THREE.HemisphereLight(0xffffff, 0x444444)
          hemiLight.position.set(0, 200, 0)
          scene.add(hemiLight)

          const dirLight = new THREE.DirectionalLight(0xffffff)
          dirLight.position.set(0, 200, 100)
          dirLight.castShadow = true
          dirLight.shadow.camera.top = 180
          dirLight.shadow.camera.bottom = -100
          dirLight.shadow.camera.left = -120
          dirLight.shadow.camera.right = 120
          scene.add(dirLight)
        }

        function initGround(flag = true) { // 
          if (!flag) return
          const mesh = new THREE.Mesh(new THREE.PlaneGeometry(2000, 2000), new THREE.MeshPhongMaterial({ color: 0x999999, depthWrite: false }))
          mesh.rotation.x = - Math.PI / 2
          mesh.receiveShadow = true
          scene.add(mesh)

          const grid = new THREE.GridHelper(2000, 20, 0x000000, 0x000000)
          grid.material.opacity = 0.2
          grid.material.transparent = true
          scene.add(grid)
        }

        function setupDatGui(bones, animations) { // 
          const folder = gui.addFolder('animation')
          folder.add({
            pause: () => {
              isPause = true
            }
          }, 'pause')
          folder.add({
            start: () => {
              isPause = false
            }
          }, 'start')
          folder.add({
            end: () => {
              mixer.stopAllAction()
              staticAnimationAction.play()
            }
          }, 'end')
          animations.forEach(animation => {
            const folder = gui.addFolder(animation._clip.name)
            // folder.add(animation, 'time', 0, animation._clip.duration)
            folder.add({
              play: () => {
                mixer.stopAllAction()
                animation.play().reset()
              }
            }, 'play')
          })
          for (const key in bones) {
            bones[key].forEach(bone => {
              const folder = gui.addFolder(bone.name)
              folder.add( bone.position, 'x', - 10 + bone.position.x, 10 + bone.position.x );
              folder.add( bone.position, 'y', - 10 + bone.position.y, 10 + bone.position.y );
              folder.add( bone.position, 'z', - 10 + bone.position.z, 10 + bone.position.z );

              folder.add( bone.rotation, 'x', - Math.PI * 0.5, Math.PI * 0.5 );
              folder.add( bone.rotation, 'y', - Math.PI * 0.5, Math.PI * 0.5 );
              folder.add( bone.rotation, 'z', - Math.PI * 0.5, Math.PI * 0.5 );

              folder.add( bone.scale, 'x', 0, 2 );
              folder.add( bone.scale, 'y', 0, 2 );
              folder.add( bone.scale, 'z', 0, 2 );

              folder.controllers[ 0 ].name( 'position.x' );
              folder.controllers[ 1 ].name( 'position.y' );
              folder.controllers[ 2 ].name( 'position.z' );

              folder.controllers[ 3 ].name( 'rotation.x' );
              folder.controllers[ 4 ].name( 'rotation.y' );
              folder.controllers[ 5 ].name( 'rotation.z' );

              folder.controllers[ 6 ].name( 'scale.x' );
              folder.controllers[ 7 ].name( 'scale.y' );
              folder.controllers[ 8 ].name( 'scale.z' );
            })
          }
        }

        function render() { // 
          requestAnimationFrame(render)
          const delta = clock.getDelta();
          !isPause && mixer && mixer.update(delta)
          renderer.render(scene, camera)
          stats && stats.update()
        }
      }(window.THREE, window.Stats, {
        url: './model/Samba Dancing.fbx',
        // noStats: true,
        // noGround: true
      })
    </script>
